import "../App.css";
//import Article from "./Article";

async function getArticles() {
  try {
    const url = "http://localhost:5000/articles";
    let data = await (await fetch(url)).json();
    return data;
  } catch (err) {
    console.error(err);
  }
}

const Articles = () => {
  const array = getArticles();
  console.log(array);
};

export default Articles;
